"use strict";(self.webpackChunkunesco=self.webpackChunkunesco||[]).push([[82],{82:t=>{t.exports=JSON.parse('[{"year1":"1990","title1":"\u041a\u0438\u0457\u0432: \u0421\u043e\u0444\u0456\u0439\u0441\u044c\u043a\u0438\u0439 \u0441\u043e\u0431\u043e\u0440 \u0442\u0430 \u043f\u043e\u0432\'\u044f\u0437\u0430\u043d\u0456 \u0437 \u043d\u0438\u043c \u043c\u043e\u043d\u0430\u0441\u0442\u0438\u0440\u0441\u044c\u043a\u0456 \u0431\u0443\u0434\u0456\u0432\u043b\u0456, \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u0430 \u043b\u0430\u0432\u0440\u0430","text1":"\u041f\u043e\u043a\u043b\u0438\u043a\u0430\u043d\u0438\u0439 \u0441\u0442\u0430\u0442\u0438 \u0441\u0443\u043f\u0435\u0440\u043d\u0438\u043a\u043e\u043c \u0445\u0440\u0430\u043c\u0443 \u0410\u0439\u044f-\u0421\u043e\u0444\u0456\u044f \u0443 \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u0456, \u0421\u043e\u0444\u0456\u0439\u0441\u044c\u043a\u0438\u0439 \u0441\u043e\u0431\u043e\u0440 \u0441\u0438\u043c\u0432\u043e\u043b\u0456\u0437\u0443\u0432\u0430\u0432 \u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u041a\u0438\u0454\u0432\u0430 \u2013 \u0441\u0442\u043e\u043b\u0438\u0446\u0456 \u0445\u0440\u0438\u0441\u0442\u0438\u044f\u043d\u0441\u044c\u043a\u043e\u0433\u043e \u043a\u043d\u044f\u0437\u0456\u0432\u0441\u0442\u0432\u0430 \u044f\u043a \xab\u041d\u043e\u0432\u043e\u0433\u043e \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044f\xbb. \u0421\u043e\u0431\u043e\u0440 \u0431\u0443\u043b\u043e \u0437\u0432\u0435\u0434\u0435\u043d\u043e XI \u0441\u0442., \u0442\u043e\u0431\u0442\u043e. \u043d\u0435\u0432\u0434\u043e\u0432\u0437\u0456 \u043f\u0456\u0441\u043b\u044f \u0445\u0440\u0435\u0449\u0435\u043d\u043d\u044f \u0420\u0443\u0441\u0456 (988 \u0440.) \u0437\u0430 \u043a\u043d\u044f\u0437\u044f \u0412\u043e\u043b\u043e\u0434\u0438\u043c\u0438\u0440\u0430. \u0414\u0443\u0445\u043e\u0432\u043d\u0438\u0439 \u0442\u0430 \u0456\u043d\u0442\u0435\u043b\u0435\u043a\u0442\u0443\u0430\u043b\u044c\u043d\u0438\u0439 \u0432\u043f\u043b\u0438\u0432 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0457 \u043b\u0430\u0432\u0440\u0438 \u0441\u043f\u0440\u0438\u044f\u0432 \u043f\u043e\u0448\u0438\u0440\u0435\u043d\u043d\u044e \u043f\u0440\u0430\u0432\u043e\u0441\u043b\u0430\u0432\u043d\u043e\u0457 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u0438 \u0442\u0430 \u043f\u0440\u0430\u0432\u043e\u0441\u043b\u0430\u0432\u043d\u043e\u0457 \u0432\u0456\u0440\u0438 \u043d\u0430 \u0420\u0443\u0441\u0456 \u0432 \u043f\u0435\u0440\u0456\u043e\u0434 \u0437 XVII \u0434\u043e XIX \u0441\u0442.","year2":"1998","title2":"\u0410\u043d\u0441\u0430\u043c\u0431\u043b\u044c \u0456\u0441\u0442\u043e\u0440\u0438\u0447\u043d\u043e\u0433\u043e \u0446\u0435\u043d\u0442\u0440\u0443 \u041b\u044c\u0432\u043e\u0432\u0430","text2":"\u041b\u044c\u0432\u0456\u0432, \u0437\u0430\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u0439 \u0443 \u043f\u0456\u0437\u043d\u044c\u043e\u043c\u0443 \u0441\u0435\u0440\u0435\u0434\u043d\u044c\u043e\u0432\u0456\u0447\u0447\u0456, \u043f\u0440\u043e\u0442\u044f\u0433\u043e\u043c \u043a\u0456\u043b\u044c\u043a\u043e\u0445 \u0441\u0442\u043e\u043b\u0456\u0442\u044c \u0431\u0443\u0432 \u043f\u0440\u043e\u0446\u0432\u0456\u0442\u0430\u044e\u0447\u0438\u043c \u0430\u0434\u043c\u0456\u043d\u0456\u0441\u0442\u0440\u0430\u0442\u0438\u0432\u043d\u0438\u043c, \u0440\u0435\u043b\u0456\u0433\u0456\u0439\u043d\u0438\u043c \u0442\u0430 \u0442\u043e\u0440\u0433\u043e\u0432\u0438\u043c \u0446\u0435\u043d\u0442\u0440\u043e\u043c. \u0421\u0435\u0440\u0435\u0434\u043d\u044c\u043e\u0432\u0456\u0447\u043d\u0435 \u043f\u043b\u0430\u043d\u0443\u0432\u0430\u043d\u043d\u044f \u043c\u0456\u0441\u0442\u0430 \u0437\u0431\u0435\u0440\u0435\u0433\u043b\u043e\u0441\u044f \u0434\u043e \u043d\u0430\u0448\u0438\u0445 \u0434\u043d\u0456\u0432 \u043f\u0440\u0430\u043a\u0442\u0438\u0447\u043d\u043e \u0431\u0435\u0437 \u0437\u043c\u0456\u043d (\u0437\u043e\u043a\u0440\u0435\u043c\u0430, \u0437\u0431\u0435\u0440\u0435\u0433\u043b\u0438\u0441\u044f \u0441\u0432\u0456\u0434\u043e\u0446\u0442\u0432\u0430 \u043f\u0440\u043e \u0440\u0456\u0437\u043d\u0456 \u0435\u0442\u043d\u0456\u0447\u043d\u0456 \u0433\u0440\u043e\u043c\u0430\u0434\u0438, \u0449\u043e \u0436\u0438\u043b\u0438 \u0442\u0443\u0442). \u0422\u0430\u043a\u043e\u0436 \u0443\u0446\u0456\u043b\u0456\u043b\u043e \u0431\u0435\u0437\u043b\u0456\u0447 \u043f\u0440\u0435\u043a\u0440\u0430\u0441\u043d\u0438\u0445 \u0431\u0430\u0440\u043e\u0447\u043d\u0438\u0445 \u0442\u0430 \u043f\u0456\u0437\u043d\u0456\u0448\u0438\u0445 \u0431\u0443\u0434\u0456\u0432\u0435\u043b\u044c."},{"year1":"2005","title1":"\u0413\u0435\u043e\u0434\u0435\u0437\u0438\u0447\u043d\u0430 \u0434\u0443\u0433\u0430 \u0421\u0442\u0440\u0443\u0432\u0435","text1":"\xab\u0414\u0443\u0433\u0430 \u0421\u0442\u0440\u0443\u0432\u0435\xbb \u2013 \u0446\u0435 \u043b\u0430\u043d\u0446\u044e\u0433 \u0442\u0440\u0456\u0430\u043d\u0433\u0443\u043b\u044f\u0446\u0456\u0439\u043d\u0438\u0445 \u043f\u0443\u043d\u043a\u0442\u0456\u0432, \u0449\u043e \u043f\u0440\u043e\u0441\u0442\u044f\u0433\u0441\u044f \u043d\u0430 2820 \u043a\u043c \u043f\u043e \u0442\u0435\u0440\u0438\u0442\u043e\u0440\u0456\u0457 \u0434\u0435\u0441\u044f\u0442\u0438 \u0454\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u044c\u043a\u0438\u0445 \u043a\u0440\u0430\u0457\u043d \u0432\u0456\u0434 \u0425\u0430\u043c\u043c\u0435\u0440\u0444\u0435\u0441\u0442\u0443 \u0432 \u041d\u043e\u0440\u0432\u0435\u0433\u0456\u0457 \u0434\u043e \u0427\u043e\u0440\u043d\u043e\u0433\u043e \u043c\u043e\u0440\u044f. \u0426\u0456 \u043e\u043f\u043e\u0440\u043d\u0456 \u0442\u043e\u0447\u043a\u0438 \u0441\u043f\u043e\u0441\u0442\u0435\u0440\u0435\u0436\u0435\u043d\u044c \u0431\u0443\u043b\u043e \u0437\u0430\u043a\u043b\u0430\u0434\u0435\u043d\u043e \u043f\u0435\u0440\u0456\u043e\u0434 1816-1855 \u0433\u0433. \u0430\u0441\u0442\u0440\u043e\u043d\u043e\u043c\u043e\u043c \u0424\u0440\u0456\u0434\u0440\u0456\u0445\u043e\u043c \u0413\u0435\u043e\u0440\u0433\u043e\u043c \u0412\u0456\u043b\u044c\u0433\u0435\u043b\u044c\u043c\u043e\u043c \u0421\u0442\u0440\u0443\u0432\u0435 (\u0432\u0456\u043d \u0436\u0435 \u2013 \u0412\u0430\u0441\u0438\u043b\u044c \u042f\u043a\u043e\u0432\u0438\u0447 \u0421\u0442\u0440\u0443\u0432\u0435), \u044f\u043a\u0438\u0439 \u0437\u0440\u043e\u0431\u0438\u0432 \u0442\u0430\u043a\u0438\u043c \u0447\u0438\u043d\u043e\u043c \u043f\u0435\u0440\u0448\u0438\u0439 \u0434\u043e\u0441\u0442\u043e\u0432\u0456\u0440\u043d\u0438\u0439 \u0432\u0438\u043c\u0456\u0440 \u0432\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u0441\u0435\u0433\u043c\u0435\u043d\u0442\u0430 \u0434\u0443\u0433\u0438 \u0437\u0435\u043c\u043d\u043e\u0433\u043e \u043c\u0435\u0440\u0438\u0434\u0456\u0430\u043d\u0430. \u0426\u0435 \u0434\u043e\u0437\u0432\u043e\u043b\u0438\u043b\u043e \u0442\u043e\u0447\u043d\u043e \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0438 \u0440\u043e\u0437\u043c\u0456\u0440 \u0456 \u0444\u043e\u0440\u043c\u0443 \u043d\u0430\u0448\u043e\u0457 \u043f\u043b\u0430\u043d\u0435\u0442\u0438, \u0449\u043e \u0441\u0442\u0430\u043b\u043e \u0432\u0430\u0436\u043b\u0438\u0432\u0438\u043c \u043a\u0440\u043e\u043a\u043e\u043c \u0443 \u0440\u043e\u0437\u0432\u0438\u0442\u043a\u0443 \u043d\u0430\u0443\u043a \u043f\u0440\u043e \u0417\u0435\u043c\u043b\u044e \u0442\u0430 \u0442\u043e\u043f\u043e\u0433\u0440\u0430\u0444\u0456\u0447\u043d\u043e\u0433\u043e \u043a\u0430\u0440\u0442\u0443\u0432\u0430\u043d\u043d\u044f. \u0426\u0435 \u0431\u0443\u0432 \u0432\u0438\u043d\u044f\u0442\u043a\u043e\u0432\u0438\u0439 \u043f\u0440\u0438\u043a\u043b\u0430\u0434 \u0441\u043f\u0456\u0432\u043f\u0440\u0430\u0446\u0456 \u0443 \u043d\u0430\u0443\u043a\u043e\u0432\u0456\u0439 \u0441\u0444\u0435\u0440\u0456 \u043c\u0456\u0436 \u0432\u0447\u0435\u043d\u0438\u043c\u0438 \u0440\u0456\u0437\u043d\u0438\u0445 \u043a\u0440\u0430\u0457\u043d \u0442\u0430 \u043c\u0456\u0436 \u043f\u0440\u0430\u0432\u043b\u044f\u0447\u0438\u043c\u0438 \u043c\u043e\u043d\u0430\u0440\u0445\u0430\u043c\u0438. \u0421\u043f\u043e\u0447\u0430\u0442\u043a\u0443 \xab\u0434\u0443\u0433\u0430\xbb \u0441\u043a\u043b\u0430\u0434\u0430\u043b\u0430\u0441\u044f \u0437 258 \u0433\u0435\u043e\u0434\u0435\u0437\u0438\u0447\u043d\u0438\u0445 \xab\u0442\u0440\u0438\u043a\u0443\u0442\u043d\u0438\u043a\u0456\u0432\xbb (\u043f\u043e\u043b\u0456\u0433\u043e\u043d\u0456\u0432) \u0456\u0437 265 \u043e\u0441\u043d\u043e\u0432\u043d\u0438\u043c\u0438 \u0442\u0440\u0456\u0430\u043d\u0433\u0443\u043b\u044f\u0446\u0456\u0439\u043d\u0438\u043c\u0438 \u043f\u0443\u043d\u043a\u0442\u0430\u043c\u0438. \u0423 \u043e\u0431\'\u0454\u043a\u0442 \u0432\u0441\u0435\u0441\u0432\u0456\u0442\u043d\u044c\u043e\u0457 \u0441\u043f\u0430\u0434\u0449\u0438\u043d\u0438 \u0443\u0432\u0456\u0439\u0448\u043b\u0438 34 \u0442\u0430\u043a\u0438\u0445 \u043f\u0443\u043d\u043a\u0442\u0438 (\u043d\u0430\u0439\u0431\u0456\u043b\u044c\u0448 \u0434\u043e\u0431\u0440\u0435 \u0432\u0446\u0456\u043b\u0456\u043b\u0438\u0445 \u0434\u043e \u0442\u0435\u043f\u0435\u0440\u0456\u0448\u043d\u044c\u043e\u0433\u043e \u0447\u0430\u0441\u0443), \u044f\u043a\u0456 \u043c\u0430\u0440\u043a\u043e\u0432\u0430\u043d\u0456 \u043d\u0430 \u043c\u0456\u0441\u0446\u0435\u0432\u043e\u0441\u0442\u0456 \u0440\u0456\u0437\u043d\u0438\u043c \u0447\u0438\u043d\u043e\u043c, \u044f\u043a \u0442\u043e: \u0432\u0438\u0434\u043e\u0432\u0431\u0430\u043d\u0456 \u0432 \u0441\u043a\u0435\u043b\u044f\u0445 \u043f\u043e\u0433\u043b\u0438\u0431\u043b\u0435\u043d\u043d\u044f, \u0437\u0430\u043b\u0456\u0437\u043d\u0456 \u0445\u0440\u0435\u0441\u0442\u0438, \u043f\u0456\u0440\u0430\u043c\u0456\u0434\u0438 \u0437 \u043a\u0430\u043c\u0435\u043d\u0456\u0432 \u0430\u0431\u043e \u0441\u043f\u0435\u0446\u0456\u0430\u043b\u044c\u043d\u043e \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0456 \u043e\u0431\u0435\u043b\u0456\u0441\u043a\u0438.","year2":"2007","title2":"\u0414\u0430\u0432\u043d\u0456 \u0442\u0430 \u043f\u0435\u0440\u0432\u0456\u0441\u043d\u0456 \u0431\u0443\u043a\u043e\u0432\u0456 \u043b\u0456\u0441\u0438 \u041a\u0430\u0440\u043f\u0430\u0442 \u0442\u0430 \u0456\u043d\u0448\u0438\u0445 \u0440\u0435\u0433\u0456\u043e\u043d\u0456\u0432 \u0404\u0432\u0440\u043e\u043f\u0438","text2":"\u0420\u043e\u0437\u0448\u0438\u0440\u0435\u043d\u043d\u044f \u0442\u0435\u0440\u0438\u0442\u043e\u0440\u0456\u0457 \u0442\u0440\u0430\u043d\u0441\u043d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0441\u0435\u0440\u0456\u0439\u043d\u043e\u0433\u043e \u043e\u0431\'\u0454\u043a\u0442\u0430 \u0432\u0441\u0435\u0441\u0432\u0456\u0442\u043d\u044c\u043e\u0457 \u0441\u043f\u0430\u0434\u0449\u0438\u043d\u0438 \xab\u0421\u0442\u0430\u0440\u043e\u0434\u0430\u0432\u043d\u0456 \u0442\u0430 \u043f\u0435\u0440\u0432\u0456\u0441\u043d\u0456 \u0431\u0443\u043a\u043e\u0432\u0456 \u043b\u0456\u0441\u0438 \u041a\u0430\u0440\u043f\u0430\u0442 \u0442\u0430 \u0456\u043d\u0448\u0438\u0445 \u0440\u0435\u0433\u0456\u043e\u043d\u0456\u0432 \u0404\u0432\u0440\u043e\u043f\u0438\xbb \u0449\u0435 \u043d\u0430 \u0434\u0435\u0441\u044f\u0442\u044c \u0454\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u044c\u043a\u0438\u0445 \u043a\u0440\u0430\u0457\u043d \u043f\u0456\u0434\u0432\u0438\u0449\u0443\u0454 \u0432\u0438\u043d\u044f\u0442\u043a\u043e\u0432\u0443 \u0443\u043d\u0456\u0432\u0435\u0440\u0441\u0430\u043b\u044c\u043d\u0443 \u0446\u0456\u043d\u043d\u0456\u0441\u0442\u044c \u0442\u0430 \u0446\u0456\u043b\u0456\u0441\u043d\u0456\u0441\u0442\u044c \u043e\u0431\'\u0454\u043a\u0442\u0430, \u0449\u043e \u0442\u0435\u043f\u0435\u0440 \u0441\u043a\u043b\u0430\u0434\u0430\u0454\u0442\u044c\u0441\u044f \u0437 93 \u0441\u043a\u043b\u0430\u0434\u043e\u0432\u0438\u0445 \u0447\u0430\u0441\u0442\u0438\u043d \u0443 18 \u043a\u0440\u0430\u0457\u043d\u0430\u0445. \u0420\u043e\u0437\u0448\u0438\u0440\u0435\u043d\u0430 \u0442\u0435\u0440\u0438\u0442\u043e\u0440\u0456\u044f \u043e\u0431\'\u0454\u043a\u0442\u0430 \u0454 \u0432\u0438\u0434\u0430\u0442\u043d\u0438\u043c \u043f\u0440\u0438\u043a\u043b\u0430\u0434\u043e\u043c \u0449\u043e\u0434\u043e \u043d\u0435\u0434\u043e\u0442\u043e\u0440\u043a\u0430\u043d\u0438\u0445 \u0441\u043a\u043b\u0430\u0434\u043d\u0438\u0445 \u043b\u0456\u0441\u0456\u0432 \u043f\u043e\u043c\u0456\u0440\u043d\u043e\u0433\u043e \u043f\u043e\u044f\u0441\u0443 \u0442\u0430 \u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0443\u0454 \u0448\u0438\u0440\u043e\u043a\u0438\u0439 \u0441\u043f\u0435\u043a\u0442\u0440 \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0441\u043d\u0438\u0445 \u0435\u043a\u043e\u043b\u043e\u0433\u0456\u0447\u043d\u0438\u0445 \u043c\u043e\u0434\u0435\u043b\u0435\u0439 \u0442\u0430 \u043f\u0440\u043e\u0446\u0435\u0441\u0456\u0432 \u0447\u0438\u0441\u0442\u0438\u0445 \u0442\u0430 \u0437\u043c\u0456\u0448\u0430\u043d\u0438\u0445 \u0454\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u044c\u043a\u0438\u0445 \u0431\u0443\u043a\u043e\u0432\u0438\u0445 \u043d\u0430\u0441\u0430\u0434\u0436\u0435\u043d\u044c \u0443 \u0440\u0456\u0437\u043d\u0438\u0445 \u0435\u043a\u043e\u043b\u043e\u0433\u0456\u0447\u043d\u0438\u0445 \u0443\u043c\u043e\u0432\u0430\u0445."},{"year1":"2011","title1":"\u0420\u0435\u0437\u0438\u0434\u0435\u043d\u0446\u0456\u044f \u043c\u0438\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0456\u0432 \u0411\u0443\u043a\u043e\u0432\u0438\u043d\u0438 \u0456 \u0414\u0430\u043b\u043c\u0430\u0446\u0456\u0457","text1":"\u0420\u0435\u0437\u0438\u0434\u0435\u043d\u0446\u0456\u044f \u043c\u0438\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0456\u0432 \u0411\u0443\u043a\u043e\u0432\u0438\u043d\u0438 \u0442\u0430 \u0414\u0430\u043b\u043c\u0430\u0446\u0456\u0457 \u044f\u0432\u043b\u044f\u0454 \u0441\u043e\u0431\u043e\u044e \u043c\u0430\u0439\u0441\u0442\u0435\u0440\u043d\u0435 \u043f\u043e\u0454\u0434\u043d\u0430\u043d\u043d\u044f \u0430\u0440\u0445\u0456\u0442\u0435\u043a\u0442\u0443\u0440\u043d\u0438\u0445 \u0441\u0442\u0438\u043b\u0456\u0432, \u043f\u043e\u0431\u0443\u0434\u043e\u0432\u0430\u043d\u0438\u0445 \u0447\u0435\u0441\u044c\u043a\u0438\u043c \u0430\u0440\u0445\u0456\u0442\u0435\u043a\u0442\u043e\u0440\u043e\u043c \u0419\u043e\u0437\u0435\u0444\u043e\u043c \u0413\u043b\u0430\u0432\u043a\u043e\u044e \u0437 1864 \u043f\u043e 1882 \u0440\u043e\u043a\u0438. \u0412\u043b\u0430\u0441\u043d\u0456\u0441\u0442\u044c, \u0432\u0438\u0434\u0430\u0442\u043d\u0438\u0439 \u0437\u0440\u0430\u0437\u043e\u043a \u0456\u0441\u0442\u043e\u0440\u0438\u0441\u0442\u0441\u044c\u043a\u043e\u0457 \u0430\u0440\u0445\u0456\u0442\u0435\u043a\u0442\u0443\u0440\u0438 19-\u0433\u043e \u0441\u0442\u043e\u043b\u0456\u0442\u0442\u044f, \u0442\u0430\u043a\u043e\u0436 \u0432\u043a\u043b\u044e\u0447\u0430\u0454 \u0441\u0435\u043c\u0456\u043d\u0430\u0440\u0456\u044e \u0442\u0430 \u043c\u043e\u043d\u0430\u0441\u0442\u0438\u0440 \u0456 \u0434\u043e\u043c\u0456\u043d\u0443\u0454 \u043a\u0443\u043f\u043e\u043b\u043e\u043c. , \u0445\u0440\u0435\u0441\u0442\u043e\u043f\u043e\u0434\u0456\u0431\u043d\u0430 \u0441\u0435\u043c\u0456\u043d\u0430\u0440\u0441\u044c\u043a\u0430 \u0446\u0435\u0440\u043a\u0432\u0430 \u0437 \u0441\u0430\u0434\u043e\u043c \u0456 \u043f\u0430\u0440\u043a\u043e\u043c. \u041a\u043e\u043c\u043f\u043b\u0435\u043a\u0441 \u0432\u0438\u0440\u0430\u0436\u0430\u0454 \u0430\u0440\u0445\u0456\u0442\u0435\u043a\u0442\u0443\u0440\u043d\u0438\u0439 \u0456 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u043d\u0438\u0439 \u0432\u043f\u043b\u0438\u0432 \u0432\u0456\u0434 \u0432\u0456\u0437\u0430\u043d\u0442\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e \u043f\u0435\u0440\u0456\u043e\u0434\u0443 \u0456 \u0432\u0442\u0456\u043b\u044e\u0454 \u043f\u043e\u0442\u0443\u0436\u043d\u0443 \u043f\u0440\u0438\u0441\u0443\u0442\u043d\u0456\u0441\u0442\u044c \u043f\u0440\u0430\u0432\u043e\u0441\u043b\u0430\u0432\u043d\u043e\u0457 \u0446\u0435\u0440\u043a\u0432\u0438 \u043f\u0456\u0434 \u0447\u0430\u0441 \u043f\u0440\u0430\u0432\u043b\u0456\u043d\u043d\u044f \u0413\u0430\u0431\u0441\u0431\u0443\u0440\u0433\u0456\u0432, \u0432\u0456\u0434\u0434\u0437\u0435\u0440\u043a\u0430\u043b\u044e\u044e\u0447\u0438 \u043f\u043e\u043b\u0456\u0442\u0438\u043a\u0443 \u0432\u0456\u0440\u043e\u0442\u0435\u0440\u043f\u0438\u043c\u043e\u0441\u0442\u0456 \u0410\u0432\u0441\u0442\u0440\u043e-\u0423\u0433\u043e\u0440\u0441\u044c\u043a\u043e\u0457 \u0456\u043c\u043f\u0435\u0440\u0456\u0457.","year2":"2013","title2":"\u0410\u043d\u0442\u0438\u0447\u043d\u0435 \u043c\u0456\u0441\u0442\u043e \u0425\u0435\u0440\u0441\u043e\u043d\u0435\u0441 \u0422\u0430\u0432\u0440\u0456\u0439\u0441\u044c\u043a\u0438\u0439 \u0456 \u0439\u043e\u0433\u043e \u0425\u043e\u0440\u0430","text2":"\u041d\u0430 \u0446\u044c\u043e\u043c\u0443 \u043c\u0456\u0441\u0446\u0456 \u0437\u043d\u0430\u0445\u043e\u0434\u044f\u0442\u044c\u0441\u044f \u0437\u0430\u043b\u0438\u0448\u043a\u0438 \u043c\u0456\u0441\u0442\u0430, \u0437\u0430\u0441\u043d\u043e\u0432\u0430\u043d\u043e\u0433\u043e \u0434\u043e\u0440\u0456\u0439\u0441\u044c\u043a\u0438\u043c\u0438 \u0433\u0440\u0435\u043a\u0430\u043c\u0438 \u0432 5 \u0441\u0442\u043e\u043b\u0456\u0442\u0442\u0456 \u0434\u043e \u043d\u0430\u0448\u043e\u0457 \u0435\u0440\u0438 \u043d\u0430 \u043f\u0456\u0432\u043d\u0456\u0447\u043d\u043e\u043c\u0443 \u0431\u0435\u0440\u0435\u0437\u0456 \u0427\u043e\u0440\u043d\u043e\u0433\u043e \u043c\u043e\u0440\u044f. \u0412\u0456\u043d \u043e\u0445\u043e\u043f\u043b\u044e\u0454 \u0448\u0456\u0441\u0442\u044c \u0441\u043a\u043b\u0430\u0434\u043e\u0432\u0438\u0445 \u0434\u0456\u043b\u044f\u043d\u043e\u043a \u0456\u0437 \u0437\u0430\u043b\u0438\u0448\u043a\u0430\u043c\u0438 \u043c\u0456\u0441\u0442 \u0456 \u0441\u0456\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e\u0441\u043f\u043e\u0434\u0430\u0440\u0441\u044c\u043a\u0438\u043c\u0438 \u0437\u0435\u043c\u043b\u044f\u043c\u0438, \u0440\u043e\u0437\u0434\u0456\u043b\u0435\u043d\u0438\u043c\u0438 \u043d\u0430 \u043a\u0456\u043b\u044c\u043a\u0430 \u0441\u043e\u0442\u0435\u043d\u044c \u0445\u043e\u0440, \u043f\u0440\u044f\u043c\u043e\u043a\u0443\u0442\u043d\u0438\u0445 \u0434\u0456\u043b\u044f\u043d\u043e\u043a \u043e\u0434\u043d\u0430\u043a\u043e\u0432\u043e\u0433\u043e \u0440\u043e\u0437\u043c\u0456\u0440\u0443. \u041d\u0430 \u0434\u0456\u043b\u044f\u043d\u043a\u0430\u0445 \u0431\u0443\u043b\u0438 \u0432\u0438\u0440\u043e\u0449\u0435\u043d\u0456 \u0432\u0438\u043d\u043e\u0433\u0440\u0430\u0434\u043d\u0438\u043a\u0438, \u043f\u0440\u043e\u0434\u0443\u043a\u0446\u0456\u044f \u044f\u043a\u0438\u0445 \u0435\u043a\u0441\u043f\u043e\u0440\u0442\u0443\u0432\u0430\u043b\u0430\u0441\u044f \u043c\u0456\u0441\u0442\u043e\u043c, \u044f\u043a\u0435 \u043f\u0440\u043e\u0446\u0432\u0456\u0442\u0430\u043b\u043e \u0434\u043e 15 \u0441\u0442\u043e\u043b\u0456\u0442\u0442\u044f. \u041d\u0430 \u0442\u0435\u0440\u0438\u0442\u043e\u0440\u0456\u0457 \u0440\u043e\u0437\u0442\u0430\u0448\u043e\u0432\u0430\u043d\u043e \u043a\u0456\u043b\u044c\u043a\u0430 \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0441\u0456\u0432 \u0433\u0440\u043e\u043c\u0430\u0434\u0441\u044c\u043a\u0438\u0445 \u0431\u0443\u0434\u0456\u0432\u0435\u043b\u044c \u0456 \u0436\u0438\u0442\u043b\u043e\u0432\u0438\u0445 \u043a\u0432\u0430\u0440\u0442\u0430\u043b\u0456\u0432, \u0430 \u0442\u0430\u043a\u043e\u0436 \u0440\u0430\u043d\u043d\u044c\u043e\u0445\u0440\u0438\u0441\u0442\u0438\u044f\u043d\u0441\u044c\u043a\u0456 \u043f\u0430\u043c\u2019\u044f\u0442\u043a\u0438 \u043f\u043e\u0440\u044f\u0434 \u0456\u0437 \u0437\u0430\u043b\u0438\u0448\u043a\u0430\u043c\u0438 \u043f\u043e\u0441\u0435\u043b\u0435\u043d\u044c \u043a\u0430\u043c\u2019\u044f\u043d\u043e\u0433\u043e \u0442\u0430 \u0431\u0440\u043e\u043d\u0437\u043e\u0432\u043e\u0433\u043e \u0432\u0456\u043a\u0443; \u0440\u0438\u043c\u0441\u044c\u043a\u0456 \u0442\u0430 \u0441\u0435\u0440\u0435\u0434\u043d\u044c\u043e\u0432\u0456\u0447\u043d\u0456 \u0431\u0430\u0448\u0442\u043e\u0432\u0456 \u0443\u043a\u0440\u0456\u043f\u043b\u0435\u043d\u043d\u044f \u0442\u0430 \u0441\u0438\u0441\u0442\u0435\u043c\u0438 \u0432\u043e\u0434\u043e\u043f\u043e\u0441\u0442\u0430\u0447\u0430\u043d\u043d\u044f; \u0456 \u0432\u0438\u043d\u044f\u0442\u043a\u043e\u0432\u043e \u0434\u043e\u0431\u0440\u0435 \u0437\u0431\u0435\u0440\u0435\u0436\u0435\u043d\u0456 \u0437\u0440\u0430\u0437\u043a\u0438 \u043f\u043e\u0441\u0430\u0434\u043e\u043a \u0432\u0438\u043d\u043e\u0433\u0440\u0430\u0434\u043d\u0438\u043a\u0456\u0432 \u0456 \u0440\u043e\u0437\u0434\u0456\u043b\u043e\u0432\u0438\u0445 \u0441\u0442\u0456\u043d. \u0423 3 \u0441\u0442\u043e\u043b\u0456\u0442\u0442\u0456 \u043d\u0430\u0448\u043e\u0457 \u0435\u0440\u0438 \u0446\u0435 \u043c\u0456\u0441\u0446\u0435 \u0431\u0443\u043b\u043e \u0432\u0456\u0434\u043e\u043c\u0435 \u044f\u043a \u043d\u0430\u0439\u0431\u0456\u043b\u044c\u0448 \u043f\u0440\u043e\u0434\u0443\u043a\u0442\u0438\u0432\u043d\u0438\u0439 \u0432\u0438\u043d\u043e\u0440\u043e\u0431\u043d\u0438\u0439 \u0446\u0435\u043d\u0442\u0440 \u0427\u043e\u0440\u043d\u043e\u0433\u043e \u043c\u043e\u0440\u044f \u0442\u0430 \u0437\u0430\u043b\u0438\u0448\u0430\u043b\u043e\u0441\u044f \u0446\u0435\u043d\u0442\u0440\u043e\u043c \u043e\u0431\u043c\u0456\u043d\u0443 \u043c\u0456\u0436 \u0413\u0440\u0435\u0446\u044c\u043a\u043e\u044e, \u0420\u0438\u043c\u0441\u044c\u043a\u043e\u044e \u0442\u0430 \u0412\u0456\u0437\u0430\u043d\u0442\u0456\u0439\u0441\u044c\u043a\u043e\u044e \u0456\u043c\u043f\u0435\u0440\u0456\u044f\u043c\u0438 \u0442\u0430 \u043d\u0430\u0441\u0435\u043b\u0435\u043d\u043d\u044f\u043c \u043d\u0430 \u043f\u0456\u0432\u043d\u0456\u0447 \u0432\u0456\u0434 \u0427\u043e\u0440\u043d\u043e\u0433\u043e \u043c\u043e\u0440\u044f. \u0426\u0435 \u0432\u0438\u0434\u0430\u0442\u043d\u0438\u0439 \u043f\u0440\u0438\u043a\u043b\u0430\u0434 \u0434\u0435\u043c\u043e\u043a\u0440\u0430\u0442\u0438\u0447\u043d\u043e\u0457 \u043e\u0440\u0433\u0430\u043d\u0456\u0437\u0430\u0446\u0456\u0457 \u0437\u0435\u043c\u043b\u0456, \u043f\u043e\u0432\u2019\u044f\u0437\u0430\u043d\u043e\u0457 \u0437 \u0430\u043d\u0442\u0438\u0447\u043d\u0438\u043c \u043f\u043e\u043b\u0456\u0441\u043e\u043c, \u0449\u043e \u0432\u0456\u0434\u043e\u0431\u0440\u0430\u0436\u0430\u0454 \u0441\u043e\u0446\u0456\u0430\u043b\u044c\u043d\u0443 \u043e\u0440\u0433\u0430\u043d\u0456\u0437\u0430\u0446\u0456\u044e \u043c\u0456\u0441\u0442\u0430."},{"year1":"2013","title1":"\u0414\u0435\u0440\u0435\u0432\'\u044f\u043d\u0456 \u0446\u0435\u0440\u043a\u0432\u0438 \u041a\u0430\u0440\u043f\u0430\u0442\u0441\u044c\u043a\u043e\u0433\u043e \u0440\u0435\u0433\u0456\u043e\u043d\u0443 \u0432 \u041f\u043e\u043b\u044c\u0449\u0456 \u0442\u0430 \u0423\u043a\u0440\u0430\u0457\u043d\u0456","text1":"\u0422\u0440\u0430\u043d\u0441\u043d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0430 \u0432\u043b\u0430\u0441\u043d\u0456\u0441\u0442\u044c, \u0440\u043e\u0437\u0442\u0430\u0448\u043e\u0432\u0430\u043d\u0430 \u043d\u0430 \u0441\u0445\u0456\u0434\u043d\u0456\u0439 \u043e\u043a\u043e\u043b\u0438\u0446\u0456 \u0426\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u043e\u0457 \u0404\u0432\u0440\u043e\u043f\u0438, \u043d\u0430\u043b\u0456\u0447\u0443\u0454 \u0448\u0456\u0441\u0442\u043d\u0430\u0434\u0446\u044f\u0442\u044c \u0446\u0435\u0440\u043a\u043e\u0432. \u0412\u043e\u043d\u0438 \u0431\u0443\u043b\u0438 \u043f\u043e\u0431\u0443\u0434\u043e\u0432\u0430\u043d\u0456 \u0437 \u0433\u043e\u0440\u0438\u0437\u043e\u043d\u0442\u0430\u043b\u044c\u043d\u0438\u0445 \u0434\u0435\u0440\u0435\u0432\u2019\u044f\u043d\u0438\u0445 \u043a\u043e\u043b\u043e\u0434 \u0443 XVI\u2013XIX \u0441\u0442\u043e\u043b\u0456\u0442\u0442\u044f\u0445 \u0433\u0440\u043e\u043c\u0430\u0434\u0430\u043c\u0438 \u043f\u0440\u0430\u0432\u043e\u0441\u043b\u0430\u0432\u043d\u043e\u0457 \u0442\u0430 \u0433\u0440\u0435\u043a\u043e-\u043a\u0430\u0442\u043e\u043b\u0438\u0446\u044c\u043a\u043e\u0457 \u043a\u043e\u043d\u0444\u0435\u0441\u0456\u0439. \u0426\u0435\u0440\u043a\u0432\u0438 \u0441\u0432\u0456\u0434\u0447\u0430\u0442\u044c \u043f\u0440\u043e \u043e\u0441\u043e\u0431\u043b\u0438\u0432\u0443 \u0431\u0443\u0434\u0456\u0432\u0435\u043b\u044c\u043d\u0443 \u0442\u0440\u0430\u0434\u0438\u0446\u0456\u044e, \u0449\u043e \u0491\u0440\u0443\u043d\u0442\u0443\u0454\u0442\u044c\u0441\u044f \u043d\u0430 \u043f\u0440\u0430\u0432\u043e\u0441\u043b\u0430\u0432\u043d\u043e\u043c\u0443 \u0446\u0435\u0440\u043a\u043e\u0432\u043d\u043e\u043c\u0443 \u0434\u0438\u0437\u0430\u0439\u043d\u0456, \u043f\u0435\u0440\u0435\u043f\u043b\u0435\u0442\u0435\u043d\u043e\u043c\u0443 \u0437 \u0435\u043b\u0435\u043c\u0435\u043d\u0442\u0430\u043c\u0438 \u043c\u0456\u0441\u0446\u0435\u0432\u043e\u0457 \u0442\u0440\u0430\u0434\u0438\u0446\u0456\u0457 \u0442\u0430 \u0441\u0438\u043c\u0432\u043e\u043b\u0456\u0447\u043d\u0438\u043c\u0438 \u043f\u043e\u0441\u0438\u043b\u0430\u043d\u043d\u044f\u043c\u0438 \u043d\u0430 \u043a\u043e\u0441\u043c\u043e\u0433\u043e\u043d\u0456\u044e \u0457\u0445\u043d\u0456\u0445 \u0433\u0440\u043e\u043c\u0430\u0434. \u0426\u0435\u0440\u043a\u0432\u0438 \u043f\u043e\u0431\u0443\u0434\u043e\u0432\u0430\u043d\u0456 \u0432 \u0442\u0440\u0438\u0434\u0456\u043b\u044c\u043d\u043e\u043c\u0443 \u043f\u043b\u0430\u043d\u0456, \u0443\u0432\u0456\u043d\u0447\u0430\u043d\u043e\u043c\u0443 \u0432\u0456\u0434\u043a\u0440\u0438\u0442\u0438\u043c\u0438 \u0447\u043e\u0442\u0438\u0440\u0438\u0433\u0440\u0430\u043d\u043d\u0438\u043c\u0438 \u0430\u0431\u043e \u0432\u043e\u0441\u044c\u043c\u0438\u043a\u0443\u0442\u043d\u0438\u043c\u0438 \u043a\u0443\u043f\u043e\u043b\u0430\u043c\u0438 \u0442\u0430 \u043a\u0443\u043f\u043e\u043b\u0430\u043c\u0438. \u041d\u0435\u0432\u0456\u0434\u2019\u0454\u043c\u043d\u043e\u044e \u0447\u0430\u0441\u0442\u0438\u043d\u043e\u044e \u0446\u0435\u0440\u043a\u0432\u0438 \u0454 \u0437\u0430\u0441\u0442\u0430\u0432\u043a\u0438 \u0456\u043a\u043e\u043d\u043e\u0441\u0442\u0430\u0441\u0456\u0432, \u043f\u043e\u043b\u0456\u0445\u0440\u043e\u043c\u043d\u0435 \u043e\u0437\u0434\u043e\u0431\u043b\u0435\u043d\u043d\u044f \u0456\u043d\u0442\u0435\u0440\u2019\u0454\u0440\u0443 \u0442\u0430 \u0456\u043d\u0448\u0435 \u0456\u0441\u0442\u043e\u0440\u0438\u0447\u043d\u0435 \u043e\u0437\u0434\u043e\u0431\u043b\u0435\u043d\u043d\u044f. \u0412\u0430\u0436\u043b\u0438\u0432\u0438\u043c\u0438 \u0435\u043b\u0435\u043c\u0435\u043d\u0442\u0430\u043c\u0438 \u0434\u0435\u044f\u043a\u0438\u0445 \u0446\u0435\u0440\u043a\u043e\u0432 \u0454 \u0434\u0435\u0440\u0435\u0432\'\u044f\u043d\u0456 \u0434\u0437\u0432\u0456\u043d\u0438\u0446\u0456, \u0446\u0435\u0440\u043a\u043e\u0432\u043d\u0456 \u043f\u043e\u0434\u0432\u0456\u0440\'\u044f, \u0441\u0442\u043e\u0440\u043e\u0436\u043a\u0438 \u0442\u0430 \u0446\u0432\u0438\u043d\u0442\u0430\u0440\u0456.","year2":"2023","title2":"\u0406\u0441\u0442\u043e\u0440\u0438\u0447\u043d\u0438\u0439 \u0446\u0435\u043d\u0442\u0440 \u041e\u0434\u0435\u0441\u0438","text2":"\u0406\u0441\u0442\u043e\u0440\u0438\u0447\u043d\u0438\u0439 \u0446\u0435\u043d\u0442\u0440 \u041e\u0434\u0435\u0441\u0438, \u0447\u0430\u0441\u0442\u0438\u043d\u0430 \u0447\u043e\u0440\u043d\u043e\u043c\u043e\u0440\u0441\u044c\u043a\u043e\u0433\u043e \u043f\u043e\u0440\u0442\u043e\u0432\u043e\u0433\u043e \u043c\u0456\u0441\u0442\u0430, \u0441\u0442\u0432\u043e\u0440\u0435\u043d\u043e\u0433\u043e \u043d\u0430 \u043c\u0456\u0441\u0446\u0456 \u0425\u0430\u0434\u0436\u0438\u0431\u0435\u044f, \u044f\u0432\u043b\u044f\u0454 \u0441\u043e\u0431\u043e\u044e \u0449\u0456\u043b\u044c\u043d\u0443 \u0437\u0430\u0431\u0443\u0434\u043e\u0432\u0443, \u0441\u043f\u043b\u0430\u043d\u043e\u0432\u0430\u043d\u0443 \u0437\u0430 \u043a\u0430\u043d\u043e\u043d\u0430\u043c\u0438 \u043a\u043b\u0430\u0441\u0438\u0446\u0438\u0437\u043c\u0443, \u0449\u043e \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440\u0438\u0437\u0443\u0454\u0442\u044c\u0441\u044f \u0434\u0432\u043e-\u0447\u043e\u0442\u0438\u0440\u044c\u043e\u0445\u043f\u043e\u0432\u0435\u0440\u0445\u043e\u0432\u0438\u043c\u0438 \u0431\u0443\u0434\u0438\u043d\u043a\u0430\u043c\u0438 \u0442\u0430 \u0448\u0438\u0440\u043e\u043a\u0438\u043c\u0438 \u043f\u0435\u0440\u043f\u0435\u043d\u0434\u0438\u043a\u0443\u043b\u044f\u0440\u043d\u0438\u043c\u0438 \u0432\u0443\u043b\u0438\u0446\u044f\u043c\u0438, \u043e\u0431\u0441\u0430\u0434\u0436\u0435\u043d\u0438\u043c\u0438 \u0434\u0435\u0440\u0435\u0432\u0430\u043c\u0438. . \u0406\u0441\u0442\u043e\u0440\u0438\u0447\u043d\u0456 \u0431\u0443\u0434\u0456\u0432\u043b\u0456 \u0432\u0456\u0434\u043e\u0431\u0440\u0430\u0436\u0430\u044e\u0442\u044c \u0448\u0432\u0438\u0434\u043a\u0438\u0439 \u0435\u043a\u043e\u043d\u043e\u043c\u0456\u0447\u043d\u0438\u0439 \u0440\u043e\u0437\u0432\u0438\u0442\u043e\u043a \u043c\u0456\u0441\u0442\u0430 \u0432 19-\u043c\u0443 \u0442\u0430 \u043d\u0430 \u043f\u043e\u0447\u0430\u0442\u043a\u0443 20-\u0433\u043e \u0441\u0442\u043e\u043b\u0456\u0442\u044c. \u0421\u0430\u0439\u0442 \u0432\u043a\u043b\u044e\u0447\u0430\u0454 \u0442\u0435\u0430\u0442\u0440\u0438, \u043c\u043e\u0441\u0442\u0438, \u043f\u0430\u043c\u2019\u044f\u0442\u043d\u0438\u043a\u0438, \u0440\u0435\u043b\u0456\u0433\u0456\u0439\u043d\u0456 \u0441\u043f\u043e\u0440\u0443\u0434\u0438, \u0448\u043a\u043e\u043b\u0438, \u043f\u0440\u0438\u0432\u0430\u0442\u043d\u0456 \u043f\u0430\u043b\u0430\u0446\u0438 \u0442\u0430 \u0431\u0430\u0433\u0430\u0442\u043e\u043a\u0432\u0430\u0440\u0442\u0438\u0440\u043d\u0456 \u0431\u0443\u0434\u0438\u043d\u043a\u0438, \u043a\u043b\u0443\u0431\u0438, \u0433\u043e\u0442\u0435\u043b\u0456, \u0431\u0430\u043d\u043a\u0438, \u0442\u043e\u0440\u0433\u043e\u0432\u0456 \u0446\u0435\u043d\u0442\u0440\u0438, \u0441\u043a\u043b\u0430\u0434\u0438, \u0444\u043e\u043d\u0434\u043e\u0432\u0456 \u0431\u0456\u0440\u0436\u0456 \u0442\u0430 \u0456\u043d\u0448\u0456 \u0433\u0440\u043e\u043c\u0430\u0434\u0441\u044c\u043a\u0456 \u0442\u0430 \u0430\u0434\u043c\u0456\u043d\u0456\u0441\u0442\u0440\u0430\u0442\u0438\u0432\u043d\u0456 \u0431\u0443\u0434\u0456\u0432\u043b\u0456, \u0441\u043f\u0440\u043e\u0435\u043a\u0442\u043e\u0432\u0430\u043d\u0456 \u0430\u0440\u0445\u0456\u0442\u0435\u043a\u0442\u043e\u0440\u0430\u043c\u0438 \u0442\u0430 \u0456\u043d\u0436\u0435\u043d\u0435\u0440\u0430\u043c\u0438, \u043f\u0435\u0440\u0435\u0432\u0430\u0436\u043d\u043e \u0437 \u0406\u0442\u0430\u043b\u0456\u0457. \u0440\u0430\u043d\u043d\u0456\u0445 \u0440\u043e\u043a\u0456\u0432, \u0430\u043b\u0435 \u0439 \u0456\u043d\u0448\u0438\u0445 \u043d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0441\u0442\u0435\u0439. \u0414\u043e\u043c\u0456\u043d\u0430\u043d\u0442\u043e\u044e \u0430\u0440\u0445\u0456\u0442\u0435\u043a\u0442\u0443\u0440\u0438 \u0456\u0441\u0442\u043e\u0440\u0438\u0447\u043d\u043e\u0433\u043e \u0446\u0435\u043d\u0442\u0440\u0443 \u043c\u0456\u0441\u0442\u0430 \u0454 \u0435\u043a\u043b\u0435\u043a\u0442\u0438\u043a\u0430. \u0426\u0435 \u043c\u0456\u0441\u0446\u0435 \u0441\u0432\u0456\u0434\u0447\u0438\u0442\u044c \u043f\u0440\u043e \u0434\u0443\u0436\u0435 \u0440\u0456\u0437\u043d\u043e\u043c\u0430\u043d\u0456\u0442\u043d\u0456 \u0435\u0442\u043d\u0456\u0447\u043d\u0456 \u0442\u0430 \u0440\u0435\u043b\u0456\u0433\u0456\u0439\u043d\u0456 \u0433\u0440\u043e\u043c\u0430\u0434\u0438 \u043c\u0456\u0441\u0442\u0430, \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u044f\u044e\u0447\u0438 \u0432\u0438\u0434\u0430\u0442\u043d\u0438\u0439 \u043f\u0440\u0438\u043a\u043b\u0430\u0434 \u043c\u0456\u0436\u043a\u0443\u043b\u044c\u0442\u0443\u0440\u043d\u043e\u0433\u043e \u043e\u0431\u043c\u0456\u043d\u0443 \u0442\u0430 \u0437\u0440\u043e\u0441\u0442\u0430\u043d\u043d\u044f \u043c\u0443\u043b\u044c\u0442\u0438\u043a\u0443\u043b\u044c\u0442\u0443\u0440\u043d\u0438\u0445 \u0442\u0430 \u0431\u0430\u0433\u0430\u0442\u043e\u0435\u0442\u043d\u0456\u0447\u043d\u0438\u0445 \u043c\u0456\u0441\u0442 \u0421\u0445\u0456\u0434\u043d\u043e\u0457 \u0404\u0432\u0440\u043e\u043f\u0438 19 \u0441\u0442\u043e\u043b\u0456\u0442\u0442\u044f."}]')}}]);